snippet.description:
Funky Cards Arena sort enfin !

Des batailles epic entre les personnages de Fortnite et des poissons, des stratégies ingénieuses a base de contrôle fiscaux, des retournement de situations improbables, 97 cartes et 24 cosmétiques a collectionner dès le lancement. Funky Cards, c'est tout ça, et bien plus encore ! Faites des combats totalement loufoques dans ce jeu de carte orienter vers le fun et le funky, disponible le 25 Juin !

Funky Cards Arena (ou FCA) est un jeu de carte en ligne basé sur les "Funky Cards" du server discord "Barbecue Party" (voila le lien) https://discord.gg/52q6kJAM

Trailer fait par :

@daniel.320  ( TeXXit) - Maître Kirbo - @harmony5510 

Jeu fait par :

@harmony5510 : Programmation

Maître Kirbo : Graphisme (Mention honorable à Zeko'Chu)

@daniel.320 (TeXXit) : Concepts

